				background-color: rgba(241, 83, 110, 0.8);

				animation-delay: 0.33s;
			}

			.jumping-dots-loader span:nth-child(3) {
				animation-delay: 0.66s;
			}

			@keyframes bounce {

				}

					transform: translateY(-20px);
				}
